// Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Header.scss'; // Assurez-vous d'avoir votre fichier de style Sass correspondant

import homeLogo from '../../public/images/homeLogo.png'; // Ajoutez le chemin correct vers votre image

const Header = () => {
  return (
    <header className="header">
      <div className="header__logo">
        {/* Utilisez l'élément img pour afficher votre logo */}
        <img src={homeLogo} alt="Home Logo" />
      </div>
      <nav className="header__navbar">
        <ul>
          <li><Link to="/home">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/buy">Buy</Link></li>
          <li><Link to="/result">Result</Link></li>
          <li><Link to="/other">Other</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
